function Clear_level () {
    sprites.destroyAllSpritesOfKind(SpriteKind.swing)
    sprites.destroyAllSpritesOfKind(SpriteKind.one_up)
    sprites.destroyAllSpritesOfKind(SpriteKind.Spring)
    sprites.destroyAllSpritesOfKind(SpriteKind.skyfiller)
    sprites.destroyAllSpritesOfKind(SpriteKind.Splat_1)
    sprites.destroyAllSpritesOfKind(SpriteKind.money)
    sprites.destroyAllSpritesOfKind(SpriteKind.Splat_Spring)
    sprites.destroyAllSpritesOfKind(SpriteKind.Projectile)
    sprites.destroyAllSpritesOfKind(SpriteKind.ORB)
    sprites.destroyAllSpritesOfKind(SpriteKind.Robot_splat)
    sprites.destroyAllSpritesOfKind(SpriteKind.Fly_splat_)
    Poofy.destroy()
}
